function generer()
{
 $total = count($this->lexique);

 $trouve = false;

 do
 {
  $cycles = 0;
  $trouve = true;

  do
  {
   $motComplet = $this->lexique[mt_rand(0, $total - 1)];
  } while (strlen(str_replace("h", "", $motComplet[1])) < 4);

  do
  {
   $motPartie = $this->lexique[mt_rand(0, $total - 1)];
   $cycles++;
   if ($cycles > 16384) { $trouve = false; break; }
  } while
  ((strlen(str_replace("h", "", $motPartie[1])) < 2) ||
   (strlen($motPartie[0]) < 2) ||
   (strlen(str_replace("h", "", $motPartie[1])) >= strlen(str_replace("h", "", $motComplet[1]))) ||
   (strpos(str_replace("h", "", $motComplet[1]), str_replace("h", "", $motPartie[1])) === false));
 } while (!$trouve);

 $texte = "Je mets ";
 $texte .= $this->imprimerArticle($motPartie);
 $texte .= $motPartie[0];
 $texte .= " dans ";
 $texte .= "\"" . $motComplet[0] . "\"";

 return $texte;
}

function imprimerArticle($mot)
{
 $syll0 = mb_substr($mot[1], 0, 1);
 switch ($syll0)
 {
  case "a": case "E": case "@": case "y": case "u": case "9": case "e": case "i":
  case "5": case "o": case "2": case "w": case "§": case "O": case "j":
   return "l'";
 }

 return ($mot[2] == "f") ? "la " : "le ";
}
}

